function certificate(college_id, company_id, requested_by, technology,
		duration, date_started, date_completed) {
	$('.technology').text(technology);
	$('.duration').text(duration);
	$('.fdate').text(date_started);
	$('.tdate').text(date_completed);
	document.getElementById("hr_sign").src = "";
	jQuery
			.ajax({
				url : "getCompanyDetails?company_id=" + company_id,
				success : function(result) {
					$(".req_name").text(result.company_name);
					if (result.logo != null && result.logo != "") {
						document.getElementById("requester_logo").src = "data:image/png;base64,"
								+ result.logo
					}
				},
				global : false,
				async : false
			});

	jQuery
			.ajax({
				url : "getStudentDetails?student_id=" + requested_by,
				success : function(result) {
					var name = result.student_name;
					var str = name;
					str = str.toLowerCase().replace(/\b[a-z]/g, function(letter) {
					    return letter.toUpperCase();
					});
					$(".student_name").text(str);
				},
				global : false,
				async : false
			});
	
	jQuery
	.ajax({
		url : "getSignature?user_id=" + company_id,
		success : function(result) {
			if (result.signature!= null && result.signature!= "") {
				document.getElementById("hr_sign").src = "data:image/png;base64,"+ result.signature;
			}
		},
		global : false,
		async : false
	});
	
	jQuery
	.ajax({
		url : "get_user?user_id=" + requested_by,
		success : function(result) {
			if(result.gender == 'M'){
				$(".init").text("Mr./Mrs");
			}else{
				$(".init").text("Ms./Miss");
			}
		},
		global : false,
		async : false
	});
	
	$("#certificate_modal").modal("show");
	$("#hidden_form_id").val(college_id);
}

